ft occurred after 2010, with a discernible decline in capture fishery production, while aquaculture farming steadily rose to assume a leading role in total production.\n","\n","This transformation in the production landscape could be attributed to a range of factors, including heightened environmental awareness and possible alterations in governmental policies worldwide. These changes likely influenced the dynamics of the fishing industry, prompting a shift towards more sustainable and controlled methods such as aquaculture, while traditional capture fishery faced challenges in sustaining its previous levels of productivity."]},{"cell_type":"code","execution_count":35,"id":"14cedb17","metadata":{"execution":{"iopub.execute_input":"2023-08-07T05:56:08.946076Z","iopub.status.busy":"2023-08-07T05:56:08.944863Z","iopub.status.idle":"2023-08-07T05:56:08.976653Z","shell.execute_reply":"2023-08-07T05:56:08.97521Z"},"papermill":{"duration":0.068824,"end_time":"2023-08-07T05:56:08.978583","exception":false,"start_time":"2023-08-07T05:56:08.909759","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li>4585</li><li>5</li></ol>\n"],"text/latex":["\\begin{enumerate*}\n","\\item 4585\n","\\item 5\n","\\end{enumerate*}\n"],"text/markdown":["1. 4585\n","2. 5\n","\n","\n"],"text/plain":["[1] 4585    5"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 × 5</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>Entity</th><th scope=col>Code</th><th scope=col>Year</th><th scope=col>Capture.fisheries.production..metric.tons.</th><th scope=col>Year_Range</th></tr>\n","\t<tr><th></th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</