,"\n","Other countries' production patterns exhibit fluctuations. For instance, in the 1960s to 1970s, Peru held the leading position in capture fishery production, but its output gradually declined until the 1990s. Subsequently, production experienced a resurgence and remained consistent until 2010. However, based on our last recorded data in 2018, production once again declined. This cyclical pattern indicates that Peru tends to follow a 30-year cycle of increasing production, followed by a decline, and then another upswing after 30 years. However, it does not hold a prominent position in Aquaculture Farming compared to China.\n","\n","Overall, these trends showcase the dynamic nature of fish production in various countries, with China standing out as a dominant force in both aquaculture and capture fisheries."]},{"cell_type":"markdown","id":"aafc2a6c","metadata":{"papermill":{"duration":0.037825,"end_time":"2023-08-07T05:56:12.018577","exception":false,"start_time":"2023-08-07T05:56:11.980752","status":"completed"},"tags":[]},"source":["#### Understanding Peru's Position in Aquaculture Farming"]},{"cell_type":"markdown","id":"bcaafce6","metadata":{"papermill":{"duration":0.037856,"end_time":"2023-08-07T05:56:12.094446","exception":false,"start_time":"2023-08-07T05:56:12.05659","status":"completed"},"tags":[]},"source":["**Does Peru's our assumed cyclic trend in Capture Fishery has any relationship with Aquaculture Farming??**"]},{"cell_type":"code","execution_count":47,"id":"2f972d6e","metadata":{"execution":{"iopub.execute_input":"2023-08-07T05:56:12.17559Z","iopub.status.busy":"2023-08-07T05:56:12.174237Z","iopub.status.idle":"2023-08-07T05:56:12.198703Z","shell.execute_reply":"2023-08-07T05:56:12.196764Z"},"papermill":{"duration":0.067592,"end_time":"2023-08-07T05:56:12.201029","exception":false,"start_time":"2023-08-07T05:56:12.133437","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 ×