n Peru's engagement in Aquaculture Farming and Capture Fishery. Over the course of two decades, the production through capture fishery experienced a continuous decline until 1990. However, it subsequently rebounded until 2000, maintaining a consistent output until 2010, after which it experienced another decline until 2018. Based on this historical trend, it is plausible that the production may continue to decline until 2020, and then witness a resurgence for a decade before stabilizing or experiencing a gradual decline over the subsequent 20 years. Such a trend could indicate a deliberate effort to achieve an ecological balance within their fishery practices."]},{"cell_type":"markdown","id":"6f602cab","metadata":{"papermill":{"duration":0.03792,"end_time":"2023-08-07T05:56:12.901637","exception":false,"start_time":"2023-08-07T05:56:12.863717","status":"completed"},"tags":[]},"source":["## Analysing Non Country Entities"]},{"cell_type":"code","execution_count":51,"id":"4091c979","metadata":{"execution":{"iopub.execute_input":"2023-08-07T05:56:12.981215Z","iopub.status.busy":"2023-08-07T05:56:12.979873Z","iopub.status.idle":"2023-08-07T05:56:13.003423Z","shell.execute_reply":"2023-08-07T05:56:13.001488Z"},"papermill":{"duration":0.066067,"end_time":"2023-08-07T05:56:13.005746","exception":false,"start_time":"2023-08-07T05:56:12.939679","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 × 5</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>Entity</th><th scope=col>Code</th><th scope=col>Year</th><th scope=col>Capture.fisheries.production..metric.tons.</th><th scope=col>Year_Range</th></tr>\n","\t<tr><th></th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><th scope=row>60</th><td>Africa Eastern and Southern</td><td></td><td>1960</td><td>1485740</td><t