e graph clearly illustrates the global production trend through capture fishery. Until 2010, there was a continuous increase in production using this method, but after 2010, there was a sharp decline.\n","\n","Similar to aquaculture farming, capture fishery serves as a significant source of income for countries funded by the International Bank for Reconstruction and Development (IBRD) and the International Development Association (IDA). The funding for this sector appears to have increased after 1970, resulting in a higher production compared to the previous decade.\n","\n","The funding pattern has remained relatively consistent, leading to consistent production levels until the last recorded data in 2018, despite the significant decline in worldwide production through capture fishery after 2010.\n","\n","Interestingly, countries with low and middle incomes also show considerable interest in fish production through this technique, as evidenced by their consistent production levels following the reported increase in the 1970s."]},{"cell_type":"markdown","id":"bfc4dc98","metadata":{"papermill":{"duration":0.039977,"end_time":"2023-08-07T05:56:14.170823","exception":false,"start_time":"2023-08-07T05:56:14.130846","status":"completed"},"tags":[]},"source":["## Understanding Fish and Sea Food Production and Consumption"]},{"cell_type":"code","execution_count":55,"id":"d6aab5bf","metadata":{"execution":{"iopub.execute_input":"2023-08-07T05:56:14.255417Z","iopub.status.busy":"2023-08-07T05:56:14.253989Z","iopub.status.idle":"2023-08-07T05:56:14.361303Z","shell.execute_reply":"2023-08-07T05:56:14.359774Z"},"papermill":{"duration":0.152421,"end_time":"2023-08-07T05:56:14.363419","exception":false,"start_time":"2023-08-07T05:56:14.210998","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Rows: 11,028\n","Columns: 4\n","$ Entity                                                         \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"Afgh