ACMBAo7AAAAACOBwg4AAADASKCwAwAAADASKOwAAAAAjAQKOwAAAAAj\ngcIOAAAAwEj8H/2fxenP8VyGAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["custom_palette <- colorRampPalette(c(\"red\", \"green\", \"blue\", \"orange\", \"purple\", \"yellow\"))(11)\n","ggplot(yrwise_melted, aes(x = Year_Range, y = value,fill = variable))+\n","geom_bar(stat = \"identity\")+\n","facet_wrap(~Continent,ncol = 2, scales = \"free_y\")+\n","labs(title = \"Null Values wrt Year Range Across Continents\", x = \"Year Range\",\n","    y = \"Total Null Count\")+\n","theme_minimal()+\n","scale_fill_manual(values = custom_palette)+\n","theme(axis.text.x = element_text(angle = 45, hjust = 1), plot.title = element_text(hjust = 0.5))"]},{"cell_type":"markdown","id":"c598b288","metadata":{"papermill":{"duration":0.046443,"end_time":"2023-08-07T05:56:19.629817","exception":false,"start_time":"2023-08-07T05:56:19.583374","status":"completed"},"tags":[]},"source":["Based on the data analysis, we observe consistency in null values until 1991 in most cases. Africa has the maximum number of null values during that period, followed by Asia. However, the count of null values for the Americas and Europe, though consistent, is much lower than Africa and less than Asia. This suggests that continents with more rapid technological advancements, such as Europe and the Americas, started recording and storing data properly, while Asia seems to be in the early stages of data recording, and Africa lags behind in technological advancement, possibly leading to improper data recording and storage.\n","\n","As we progress towards the modern era, a perplexing trend emerges - there is an increasing trend in null values, with the highest count recorded until 2015. The reason behind it is the fact that we have the production data available until 2013 and the consumption data until 2017.\n","\n","Considering the number of landlocked countries across continents in 2015, it's worth exploring whether landlockedness contributes to the null values in marine-based data. Africa and Europe have the highest number of landlocked countries, which may affect their marine data recording. However, it is important to note that the distribution of null values in freshwater fish data is also similar to marine life data, making it challenging to attribute the null values solely to marine-based data for landlocked countries.\n","\n","Given the lack of a promising method for handling null values with the available data, the decision is made to replace all the null values before 1991(not included) to zero and after 2013 to zero and to decide on the null values from 1991 till 2013, we will try more comprehensive feature engineering."]},{"cell_type":"code","execution_count":79,"id":"ceaa1cd2","metadata":{"execution":{"iopub.execute_input":"2023-08-07T05:56:19.726604Z","iopub.status.busy":"2023-08-07T05:56:19.725413Z","iopub.status.idle":"2023-08-07T05:56:19.740225Z","shell.execute_reply":"2023-08-07T05:56:19.7389Z"},"papermill":{"duration":0.065659,"end_time":"2023-08-07T05:56:19.742022","exception":false,"start_time":"2023-08-07T05:56:19.676363","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".dl-inline {width: auto; margin:0; padding: 0}\n",".dl-inline>dt, .dl-inline>dd {float: none; width: auto; display: inline-block}\n",".dl-inline>dt::after {content: \":\\0020\"; padding-right: .5ex}\n",".dl-inline>dt:not(:first-of-type) {padding-left: .5ex}\n","</style><dl class=dl-inline><dt>Entity</dt><dd>0</dd><dt>Code</dt><dd>0</dd><dt>Year</dt><dd>0</dd><dt>Pelagic_Fish_Production_Tonnes</dt><dd>2017</dd><dt>Crustaceans_Production_Tonnes</dt><dd>1582</dd><dt>Cephalopods_Production_Tonnes</dt><dd>2973</dd><dt>Demersal_Production_Tonnes</dt><dd>2141</dd><dt>Freshwater_Production_Tonnes</dt><dd>960</dd><dt>Molluscs_Production_Tonnes</dt><dd>3132</dd><dt>Marine_Fish_Production_Tonnes</dt><dd>2101</dd><dt>Fish/ SeaFood Supply (kg)/capita/y