 countries. This is likely due to some coastal countries not relying heavily on freshwater fish production.\n","\n","To address this issue, we have decided on the following data handling approach:\n","\n","1. Landlocked countries: We will replace all the null values, except in the freshwater category, with zeros. The freshwater category will be denoted as NA only.\n","\n","2. Coastal countries: Null values in the freshwater category will be replaced with zeros, while all other categories will be denoted as NA only.\n","\n","By implementing these measures, we aim to ensure consistency in the data representation for both landlocked and coastal countries while accounting for their unique characteristics and limitations in fish production."]},{"cell_type":"code","execution_count":99,"id":"c3f3c129","metadata":{"execution":{"iopub.execute_input":"2023-08-07T05:56:27.376457Z","iopub.status.busy":"2023-08-07T05:56:27.375151Z","iopub.status.idle":"2023-08-07T05:56:27.410182Z","shell.execute_reply":"2023-08-07T05:56:27.408581Z"},"papermill":{"duration":0.093839,"end_time":"2023-08-07T05:56:27.412426","exception":false,"start_time":"2023-08-07T05:56:27.318587","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 10 × 14</caption>\n","<thead>\n","\t<tr><th scope=col>Entity</th><th scope=col>Code</th><th scope=col>Year</th><th scope=col>Pelagic_Fish_Production_Tonnes</th><th scope=col>Crustaceans_Production_Tonnes</th><th scope=col>Cephalopods_Production_Tonnes</th><th scope=col>Demersal_Production_Tonnes</th><th scope=col>Freshwater_Production_Tonnes</th><th scope=col>Molluscs_Production_Tonnes</th><th scope=col>Marine_Fish_Production_Tonnes</th><th scope=col>Fish/ SeaFood Supply (kg)/capita/yr</th><th scope=col>Year_Range</th><th scope=col>Continent</th><th scope=col>landlocked</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&