ear Range\", \n","     y = \"Production/Consumption (Tonnes)\", \n","     title = \"Production and Consumption Over Years\",\n","    fill = \"Category\",\n","    color = \"Category\")+\n","facet_wrap(~Continent,\n","           scales = \"free_y\", \n","           ncol = 2)+\n","scale_y_continuous(sec.axis = sec_axis(~./1000,name = \"Supply (kg/capita/yr)\",\n","                   labels = scales::comma_format(scale = 1e-3, suffix = \"K\")),\n","                   labels = scales::label_number(scale = 1e-6, suffix = \"M\"))+\n","theme(axis.text.x = element_text(hjust = 1, angle= 45))+\n","annotate(\"text\", x = \"1991-1997\", y = min(Supply$Value)*1000,\n","           label = \"Consumption\", vjust = -1.5, fontface = \"bold\",\n","        color = \"White\")\n","\n","                  "]},{"cell_type":"markdown","id":"e3139e7c","metadata":{"papermill":{"duration":0.058524,"end_time":"2023-08-07T05:56:29.704247","exception":false,"start_time":"2023-08-07T05:56:29.645723","status":"completed"},"tags":[]},"source":["Based on the above bar plot, it is evident that the consumption of fish and seafood is significantly lower across the world compared to production. The only region where consumption appears to be more active is in Oceania countries. This suggests that Oceania countries have a higher demand for fish and seafood relative to their production levels. In contrast, most other continents have a surplus of production relative to their consumption, indicating that they might be exporting or storing the excess fish and seafood. Further analysis and investigation would be required to understand the specific reasons behind these consumption and production patterns."]},{"cell_type":"code","execution_count":107,"id":"7caca051","metadata":{"execution":{"iopub.execute_input":"2023-08-07T05:56:29.82463Z","iopub.status.busy":"2023-08-07T05:56:29.823257Z","iopub.status.idle":"2023-08-07T05:56:29.849796Z","shell.execute_reply":"2023-08-07T05:56:29.848385Z"},"papermill":{"duratio