 = Production,stat = \"identity\", fill = \"Purple\")+\n","geom_line(data = Supply,\n","          aes(y = Value*1000),\n","          size = 1,group = 1, color = \"Red\")+\n","labs(x = \"Year Range\", \n","     y = \"Production/Consumption (Tonnes)\", \n","     title = \"Production and Consumption Over Years Based on Access To Sea\",\n","    fill = \"Category\",\n","    color = \"Category\")+\n","facet_wrap(~landlocked,\n","           scales = \"free_y\", \n","           ncol = 2)+\n","scale_y_continuous(sec.axis = sec_axis(~./1000,name = \"Supply (kg/capita/yr)\",\n","                   labels = scales::comma_format(scale = 1e-3, suffix = \"K\")),\n","                   labels = scales::label_number(scale = 1e-6, suffix = \"M\"))+\n","theme(axis.text.x = element_text(hjust = 1, angle= 45))+\n","annotate(\"text\", x = \"1991-1997\", y = min(Supply$Value)*1000,\n","           label = \"Consumption\", vjust = -1.5, fontface = \"bold\",\n","        color = \"White\")\n","\n","                  "]},{"cell_type":"markdown","id":"7d411c2b","metadata":{"papermill":{"duration":0.060136,"end_time":"2023-08-07T05:56:30.582025","exception":false,"start_time":"2023-08-07T05:56:30.521889","status":"completed"},"tags":[]},"source":["In the provided analysis, we observe that fish and seafood production shows an upward trend in both landlocked and coastal countries. This indicates a general increase in fishery activities over time in these regions. However, the consumption patterns show interesting differences between the two types of countries.\n","\n","In coastal countries, the consumption of fish and seafood appears to be relatively consistent over the years, with a relatively small portion of the population consuming fish regularly. This could be due to factors such as lifestyle preferences, cultural habits, or dietary choices that contribute to a stable level of consumption.\n","\n","On the other hand, in landlocked countries, we observe a noteworthy trend in consumption. After 1991, there is a significant increase in the consumption of fish and seafood, suggesting a rising demand for these products in these regions. However, it's important to note that the data after 2015 shows a sharp drop in consumption. The reason behind this decline could be attributed to various factors, including changes in dietary habits, economic fluctuations, or availability of data for those years.\n","\n","It is essential to consider potential factors and gather more data to fully understand the reasons behind these consumption trends accurately. External factors such as global trade dynamics, environmental changes, or even policy shifts could influence the consumption patterns in both coastal and landlocked countries. Further research and analysis are necessary to shed light on the underlying causes of these fluctuations in fish and seafood consumption."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":86.20335,"end_time":"2023-08-07T05:56:30.762071","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-08-07T05:55:04.558721","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}